export const Fingilish = text => {
  let pword = text + ' ';
  let pinword = '';
  let nopword = '';
  let len = pword.length;
  let mp = 1;
  let fping = null;
  let lastpword = null;
  let fper = '';

  Object.entries(preword).forEach(([key, value]) => {
    pword = pword.replace(new RegExp(key, 'g'), value);
  });

  while (mp <= len) {
    let sub = pword.substring(0, mp);

    let ping = word[sub];

    if (mp <= 14 && ping != null) {
      fping = ping;
      fper = sub;
    }

    if (mp == len || mp > 14) {
      if (fping != null) {
        pinword = pinword + fping;
        fping = null;
        mp = fper.length;
        pword = pword.substring(mp, len);
        mp = 1;
        len = pword.length;
        lastpword = pword;
      } else if (pword.length > 0) {
        nopword = pword.substring(0, 1);
        if (lastpword == null) lastpword = pword;
        pinword = pinword + nopword;
        len = lastpword.length;
        mp = 1;
        pword = pword.substring(mp, len);
      }
    }
    mp++;
  }

  Object.entries(wordrule).forEach(([key, value]) => {
    pinword = pinword.replace(new RegExp(key, 'g'), value);
  });

  Object.entries(pastword).forEach(([key, value]) => {
    pinword = pinword.replace(new RegExp(key, 'g'), value);
  });

  return pinword;
};
